import React, { useState, useEffect } from "react";
import { SafeAreaView, View, Text, TouchableOpacity, StyleSheet, ActivityIndicator, Alert, TextInput } from "react-native";
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';
import { COLORS, SIZES, FONTS } from "../../../constants";
import axios from 'axios';
import { useNavigation } from '@react-navigation/native';
import AsyncStorage from '@react-native-async-storage/async-storage';

const OrderCreate = ({ route }) => {
    const { meal, canteenName } = route.params;
    const navigation = useNavigation();
    const [loading, setLoading] = useState(false);
    const [csrfToken, setCsrfToken] = useState('');
    const [quantity, setQuantity] = useState(1); // Default quantity

    // Fetch CSRF Token
    useEffect(() => {
        const fetchCsrfToken = async () => {
            try {
                const response = await axios.get('http://127.0.0.1:8000/csrf/');
                setCsrfToken(response.data.csrfToken);
            } catch (error) {
                console.error('Error fetching CSRF token', error);
            }
        };

        fetchCsrfToken();
    }, []);

    const handleOrder = async () => {
        setLoading(true);
        try {
            const accessToken = await AsyncStorage.getItem('accessToken');
            if (!accessToken || !csrfToken) {
                console.error('Access token or CSRF token not available');
                return;
            }

            const response = await axios.post(`http://127.0.0.1:8000/create-order/`, 
                { 
                    food: meal.id, 
                    quantity: quantity 
                }, 
                {
                    headers: {
                        'Authorization': `Bearer ${accessToken}`,
                        'X-CSRFToken': csrfToken,
                        'Content-Type': 'application/json'
                    }
                }
            );

            Alert.alert("Success", "Order created successfully");
            navigation.goBack();
        } catch (error) {
            console.error("Error creating order:", error.response.data);
            Alert.alert("Error", "There was an error creating the order.");
        } finally {
            setLoading(false);
        }
    };

    if (loading) {
        return (
            <SafeAreaView style={styles.container}>
                <View style={styles.loader}>
                    <ActivityIndicator size="large" color={COLORS.primary} />
                </View>
            </SafeAreaView>
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            <View style={styles.header}>
                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => navigation.navigate("OrderList")}
                >
                    <Icon name="arrow-left" size={20} color={COLORS.black} />
                </TouchableOpacity>
                <View style={styles.titleContainer}>
                    <Text style={styles.title}>Order {meal.name}</Text>
                </View>
            </View>
            <View style={styles.contentContainer}>
                <Text style={styles.mealName}>{meal.name}</Text>
                <Text style={styles.mealDescription}>{meal.description}</Text>
                <Text style={styles.mealPrice}>â‚±{meal.price}</Text>
                <TextInput 
                    style={styles.quantityInput}
                    value={String(quantity)}
                    keyboardType="numeric"
                    onChangeText={text => setQuantity(Number(text))}
                />
                <TouchableOpacity style={styles.orderButton} onPress={handleOrder}>
                    <Text style={styles.orderButtonText}>Order Now</Text>
                </TouchableOpacity>
            </View>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: COLORS.white,
    },
    header: {
        flexDirection: 'row',
        marginVertical: SIZES.padding * 5,
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
    },
    iconButton: {
        width: 45,
        alignItems: 'center',
        justifyContent: 'center',
    },
    titleContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: COLORS.black,
        ...FONTS.h3,
    },
    contentContainer: {
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
    },
    mealName: {
        ...FONTS.h2,
        color: COLORS.black,
        marginVertical: SIZES.padding,
    },
    mealDescription: {
        ...FONTS.body3,
        color: COLORS.gray,
        textAlign: 'center',
        marginVertical: SIZES.padding,
    },
    mealPrice: {
        ...FONTS.h2,
        color: COLORS.black,
        marginVertical: SIZES.padding,
    },
    quantityInput: {
        width: 50,
        height: 40,
        borderColor: COLORS.gray,
        borderWidth: 1,
        borderRadius: 5,
        textAlign: 'center',
        marginVertical: SIZES.padding,
    },
    orderButton: {
        backgroundColor: COLORS.primary,
        borderRadius: 10,
        paddingVertical: SIZES.padding * 1.5,
        paddingHorizontal: SIZES.padding * 3,
        marginTop: SIZES.padding * 2,
    },
    orderButtonText: {
        color: COLORS.white,
        ...FONTS.h3,
    },
    loader: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
});

export default OrderCreate;
